<template>
  <div class="credit-report-hd">
    <h1>
      企业信用报告<span v-if="title"> - {{ title }}</span>
    </h1>
    <p>评估时间：{{ score.scoreAt | formatDate('zh') }}</p>
    <div class="credit-report-hd__img"></div>
  </div>
</template>

<script>
  import {createNamespacedHelpers} from 'vuex'

  const {mapState} = createNamespacedHelpers('creditReport');

export default {
  props: {
    title: {
      type: String
    }
  },
  computed: {
    ...mapState({
      // 企业报告报告总数据
      detail: 'detail'
    }),
    // 信用分
    score() {
      return (this.detail.report && this.detail.report.creditScore) || {}
    }
  }
}
</script>

